    public override object parsePosition(object position, object market = null)
    {
        //
        //    {
        //       "symbol":"BTC-PERP",
        //       "instrument_id":"114jqr89-0-0",
        //       "instrument_uuid":"b3469e0b-222c-4f8a-9f68-1f9e44d7e5e0",
        //       "vwap":"52482.3",
        //       "net_size":"0",
        //       "buy_order_size":"0.001",
        //       "sell_order_size":"0",
        //       "im_contribution":"0.2",
        //       "unrealized_pnl":"0",
        //       "mark_price":"52406.8",
        //       "entry_vwap":"52472.9"
        //    }
        //
        object marketId = this.safeString(position, "symbol");
        object quantity = this.safeString(position, "net_size");
        market = this.safeMarket(marketId, market, "-");
        object side = "long";
        if (isTrue(Precise.stringLe(quantity, "0")))
        {
            side = "short";
            quantity = Precise.stringMul("-1", quantity);
        }
        return this.safePosition(new Dictionary<string, object>() {
            { "info", position },
            { "id", this.safeString(position, "id") },
            { "symbol", getValue(market, "symbol") },
            { "entryPrice", null },
            { "markPrice", this.safeNumber(position, "mark_price") },
            { "notional", null },
            { "collateral", null },
            { "unrealizedPnl", this.safeNumber(position, "unrealized_pnl") },
            { "side", side },
            { "contracts", this.parseNumber(quantity) },
            { "contractSize", this.safeNumber(market, "contractSize") },
            { "timestamp", null },
            { "datetime", null },
            { "hedged", null },
            { "maintenanceMargin", null },
            { "maintenanceMarginPercentage", null },
            { "initialMargin", this.safeNumber(position, "im_contribution") },
            { "initialMarginPercentage", null },
            { "leverage", null },
            { "liquidationPrice", null },
            { "marginRatio", null },
            { "marginMode", null },
            { "percentage", null },
        });
    }

